import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem('user') || '{}');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  const getDashboardContent = () => {
    switch (user.role) {
      case 'student':
        return (
          <div>
            <h3>Student Dashboard</h3>
            <p>Welcome, {user.name}! You can monitor classes and ratings here.</p>
            <div className="row">
              <div className="col-md-4">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Monitoring</h5>
                    <p className="card-text">View class reports and attendance</p>
                  </div>
                </div>
              </div>
              <div className="col-md-4">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Rating</h5>
                    <p className="card-text">Rate lectures and provide feedback</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        );
      
      case 'lecturer':
        return (
          <div>
            <h3>Lecturer Dashboard</h3>
            <p>Welcome, {user.name}! Manage your classes and reports.</p>
            <div className="row">
              <div className="col-md-3">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Classes</h5>
                    <p className="card-text">Manage your classes</p>
                  </div>
                </div>
              </div>
              <div className="col-md-3">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Reports</h5>
                    <p className="card-text">Submit teaching reports</p>
                  </div>
                </div>
              </div>
              <div className="col-md-3">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Monitoring</h5>
                    <p className="card-text">Monitor student attendance</p>
                  </div>
                </div>
              </div>
              <div className="col-md-3">
                <div className="card">
                  <div className="card-body">
                    <h5 className="card-title">Rating</h5>
                    <p className="card-text">View your ratings</p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        );

      case 'principal_lecturer':
        return (
          <div>
            <h3>Principal Lecturer Dashboard</h3>
            <p>Welcome, {user.name}! Oversee courses and provide feedback.</p>
            {/* Add PRL specific content */}
          </div>
        );

      case 'program_leader':
        return (
          <div>
            <h3>Program Leader Dashboard</h3>
            <p>Welcome, {user.name}! Manage programs and lectures.</p>
            {/* Add PL specific content */}
          </div>
        );

      default:
        return <p>Loading...</p>;
    }
  };

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>LUCT Reporting System</h2>
        <div>
          <span className="me-3">Welcome, {user.name} ({user.role})</span>
          <button className="btn btn-outline-danger" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>
      
      {getDashboardContent()}
    </div>
  );
};

export default Dashboard;
